import React from 'react';


const Service = () =>{
    return (<>
        <div className= "container-fluid">
            <div className="row">
                <div className=" col-10 mx-auto">
                    <h1>My services</h1>
                </div>
            </div>
        </div>        
    </>);
}

export default Service;
